sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
      var pattern = "0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz~!@-#$&";
    var random_password = "";
    var password_lgt = [10, 15, 20, 25, 30, 35];
    var random_length = Math.floor(Math.random() * password_lgt.length);

    for (index = 0; index < password_lgt[random_length]; index++) {
        var random_number = Math.floor(Math.random() * pattern.length);
        if (random_password[random_password.length - 1] == pattern[random_number]) {
            random_number = Math.floor(Math.random() * pattern.length);
        }
        random_password += pattern[random_number];
    }

    outputs.password = random_password;
})(inputs, outputs);

